script: |
  super -f text -I q12715.spq | sort > q12715.out

inputs:
  - name: q12715.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 BETWEEN - col2 * 49 AND - - 65 + - 42 * + col1 + col0;
  - name: tab1

outputs:
  - name: q12715.out
    data: |
      51	14	96
      85	5	59
      91	47	68
